import { createNativeStackNavigator } from '@react-navigation/native-stack';
import * as React from "react";
import AccountScreen from "../AccountScreens/AccountScreen";
import Header from '../../components/Header';

const AccountStack = createNativeStackNavigator();

const currentLocation = "http://192.168.1.103:3000/api";

export default function AccountStackScreen() {
  const username = "ndt123";
  const [infor, setInfor] = useState({});

  useEffect(() => {
    axios.get(`${currentLocation}/users?username=${username}`)
      .then(res => {
        const infor = res.data;
        setInfor(infor);
      })
      .catch(error => console.log(error));
  });

  return (
    <AccountStack.Navigator>
      <AccountStack.Screen
        name="Account"
        component={AccountScreen}
        user={info}
        options={{ headerShown: false }}
      />
    </AccountStack.Navigator>
  );
};
